import ReactDOM from "react-dom/client";
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";

import styles from './App.module.css'

import { Login } from './pages/login';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="teams" element={<Login/>}/>

      </Routes>
    </BrowserRouter>
  );
}

export default App;
